--
CREATE PROCEDURE Proc_GetMaxEmployeeCode ()
SQL SECURITY INVOKER
COMMENT 'Lấy ra mã nhân viên lớn nhất'
BEGIN
  SELECT
    e.EmployeeCode
  FROM Employee e
  WHERE LENGTH(e.EmployeeCode) = (SELECT
      MAX(LENGTH(e.EmployeeCode))
    FROM Employee e)
  ORDER BY e.EmployeeCode DESC
  LIMIT 0, 1;
END
$$

